--Create table trainee
CREATE TABLE trainee (
    Employee_ID	VARCHAR(512),
    Training_Date DATE,
    Training_Program_Name	VARCHAR(512),
    Training_Type	VARCHAR(512),
    Training_Outcome	VARCHAR(512),
    Location	VARCHAR(512),
    Trainer	VARCHAR(512),
    Training_Duration_Days	INT,
    Training_Duration_Hours	VARCHAR(512),
    Training_Cost	DECIMAL
);

--Insert values into the trainee table


--view table trainee
SELECT * FROM trainee



--checking the number of column in a dataset
SELECT COUNT (*)
FROM information_schema.columns
WHERE table_name = 'trainee'
--The dataset has 3000 rows and 10 columns



--Deleting empty rows
DELETE FROM trainee
WHERE Employee_ID IS NULL
OR Training_Program_Name IS NULL
OR Trainer IS NULL



--Add training duration hours as a new column
ALTER TABLE trainee
ADD COLUMN training_duration _hours INTEGER;




--Training duration hours
SELECT Employee_ID, Training_Duration_Days, Training_Duration_Days * 24 
AS Training_Duration_Hours
FROM trainee
 



--The training date is from January 2022 to December 2023
	
	

--Research Question 1: How many employee PASSED, FAILED, COMPLETED OR INCOMPLETE the training.
	
SELECT Training_Outcome,
COUNT(DISTINCT Employee_ID) AS num_employees
FROM trainee
GROUP BY Training_Outcome
ORDER BY Training_Outcome;

--Research Answer: The number of employee that Passed are 739, Failed are 716, Completed are 770, Incomplete are 775





--Research Question 2: How many employees signed up for each program for the training

SELECT Training_Program_Name,
COUNT(DISTINCT Employee_ID) AS num_employees_signed_up
FROM trainee
GROUP BY Training_Program_Name
ORDER BY Training_Program_Name;

/*Research Answer: The number of employees that signed up for Communication Skills are 673, Customer Service are 565, 
Leadership Development are 574, Project Management are 609, Technical Skills are 579.*/





--Research Question 3: What is the training investment for the company for year 2022

SELECT SUM(Training_Cost) AS Total_training_investment
FROM trainee
WHERE DATE_PART('YEAR', training_date) = 2022; 

--Research Answer: The training investment for the year 2022 is $676,948.24





--Research Question 4: What is the training investment for the company for year 2023

SELECT SUM(Training_Cost) AS Total_training_investment
FROM trainee
WHERE DATE_PART('YEAR', training_date) = 2023; 

--Research Answer: The training investment for the year 2023 is $998,937.85






--Research Question 5: Total cost of training for year 2022 and 2023

SELECT SUM(Training_Cost) AS TotalCost
FROM trainee;

--Research Answer: The Total cost spent on training is 1,675,886.09






--Research Question 6: How many employee went for training for 1,2,3,4,5 days

SELECT Training_Duration_Days,
COUNT(DISTINCT Employee_ID) AS num_employees_training
FROM trainee
GROUP BY Training_Duration_Days
ORDER BY Training_Duration_Days;

/*Research Answer: The number of employees that went for training for 1 day is 619, 2 days is 600, 3 days is 611, 
4 days is 575 and 5 days is 595.*/





--Research Question 7: How many employee signed up for internal & external training type

SELECT Training_Type,
COUNT(DISTINCT Employee_ID) AS num_employees_training_type
FROM trainee
GROUP BY Training_Type
ORDER BY Training_Type;

--Research Answer: The number of employee for external training is 1,491 and internal training is 1,509






